import { Nav, Navbar, Container, NavDropdown } from 'react-bootstrap';

function Navi () {
    return (
        <Navbar bg="dark" variant="dark" >
            <Container>
            <Nav className="me-auto">
                <Nav.Item>
                    <Nav.Link href="#home">Home</Nav.Link>
                </Nav.Item>
                <NavDropdown title="Orders" id="navbarScrollingDropdown">
                    <NavDropdown.Item href="#uploadOrders">Upload Orders</NavDropdown.Item>
                    <NavDropdown.Item href="#inputOrders">Input Orders</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#viewOrders">View Orders</NavDropdown.Item>
                </NavDropdown>
            </Nav>
            </Container>
        </Navbar>
        
    );
}

export default Navi;
